CREATE TABLE `recgaleriarecma` (
  `rec_unikey_regl` INTEGER(11) NOT NULL AUTO_INCREMENT,
  `rec_nroreg_regl` VARCHAR(40) COLLATE utf8_general_ci NOT NULL UNIQUE COMMENT 'Código secuencial unico registro maestro',
  `apj_nroreg_aphp` VARCHAR(40) COLLATE utf8_general_ci DEFAULT NULL UNIQUE COMMENT 'Código del registro de artista o grupo musical al cual pertenece el recurso',
  `rec_observ_regl` VARCHAR(120) COLLATE utf8_general_ci DEFAULT NULL COMMENT 'Titulo del recurso o nota texto para cuando sea requerido (diligeciada por el usuario)',
  `rec_grprec_regr` VARCHAR(4) COLLATE utf8_general_ci DEFAULT NULL UNIQUE COMMENT 'Grupo al que pertenece el archivo de recurso  (grupos según se usan para vistas de configuracion en la aplicación) ejemplo:  H01=Imagen icono del perfil Home Artista H02= Imagen banner perfil HomeArtista, H03=Imagen carrusel',
  `rec_tiprec_regl` VARCHAR(1) COLLATE utf8_general_ci DEFAULT NULL COMMENT 'Tipo recurso 1=Imagen Servior Local 2=Link Video Youtube 3=Link video Facebook 4=Link video Instagram 5=Link Foto Facebook 6=Link foto Instagram 7=Imagen Servidor FireBaseStore',
  `rec_nomrec_regl` TEXT COLLATE utf8_general_ci COMMENT 'Nombre fisico del recurso dentro de las rutas del sistema',
  `rec_ordvis_regl` INTEGER(3) DEFAULT NULL COMMENT 'Orden visualizacion de los recursos dentro de vistas tales como el carrusel',
  `rec_drwpin_regl` INTEGER(1) DEFAULT NULL UNIQUE COMMENT 'Indicar si la publicacion esta anclada para mostrarse en carrusel navegacion del Home: 1=Anclado 2=no esta anclado',
  `rec_recax1_regl` TEXT COLLATE utf8_general_ci COMMENT 'Nombre fisico del recurso auxiliar 1 en caso que sea necesario',
  `rec_recax2_regl` VARCHAR(90) COLLATE utf8_general_ci DEFAULT NULL COMMENT 'Nombre fisico del recurso auxiliar 2 en caso que sea necesario',
  `rec_recax3_regl` VARCHAR(90) COLLATE utf8_general_ci DEFAULT NULL COMMENT 'Nombre fisico del recurso auxiliar 3 en caso que sea necesario',
  `rec_fecrec_regl` DATE DEFAULT NULL COMMENT 'Fecha en la cual se cargo el archivo de recurso',
  `rec_horrec_regl` DECIMAL(5,2) DEFAULT NULL COMMENT 'Hora formato militar en la cual se carga el recurso',
  `rec_rllave_regl` BIGINT(20) DEFAULT NULL UNIQUE COMMENT 'llave que concatena la fecha y hora del recurso, para descartar los antiguos y limitar vista solo a recursos mas actualizados',
  `rec_estreg_regl` VARCHAR(1) COLLATE utf8_general_ci DEFAULT NULL COMMENT 'Estado del registro: 1= Activo 2= Inactivo',
  `llave` VARCHAR(20) COLLATE utf8_general_ci DEFAULT NULL,
  PRIMARY KEY (`rec_unikey_regl`),
  KEY `regl02` (`apj_nroreg_aphp`),
  KEY `regl03` (`rec_grprec_regr`),
  KEY `regl04` (`rec_rllave_regl`),
  KEY `regl01` (`rec_nroreg_regl`),
  KEY `regl05` (`rec_drwpin_regl`))ENGINE=InnoDB;

COMMIT;

